CREATE TABLE influencer_profiles (
    influencer_id INT PRIMARY KEY,
    influencer_name VARCHAR(50),
    follower_count INT,
    engagement_rate FLOAT
);

CREATE TABLE influencer_posts (
    post_id INT PRIMARY KEY,
    influencer_id INT,
    post_content TEXT,
    post_date DATE
);

CREATE TABLE influencer_categories (
    category_id INT PRIMARY KEY,
    category_name VARCHAR(50)
);

CREATE TABLE influencer_engagement (
    engagement_id INT PRIMARY KEY,
    post_id INT,
    likes_count INT,
    comments_count INT
);

CREATE TABLE InfluencerProfile (
    influencer_id UUID PRIMARY KEY,
    influencer_name VARCHAR(50) NOT NULL,
    follower_count INT NOT NULL,
    engagement_rate FLOAT NOT NULL
);

CREATE TABLE InfluencerPost (
    post_id UUID PRIMARY KEY,
    influencer_id UUID REFERENCES InfluencerProfile(influencer_id),
    post_content TEXT NOT NULL,
    post_date DATE NOT NULL
);

CREATE TABLE InfluencerComments (
    comment_id UUID PRIMARY KEY,
    post_id UUID REFERENCES InfluencerPost(post_id),
    commenter_name VARCHAR(50) NOT NULL,
    comment_text TEXT NOT NULL
);

CREATE TABLE InfluencerAnalytics (
    analytics_id UUID PRIMARY KEY,
    influencer_id UUID REFERENCES InfluencerProfile(influencer_id),
    analysis_date DATE NOT NULL,
    engagement_score FLOAT NOT NULL
);

CREATE TABLE InfluencerSponsors (
    sponsor_id UUID PRIMARY KEY,
    influencer_id UUID REFERENCES InfluencerProfile(influencer_id),
    sponsor_name VARCHAR(50) NOT NULL,
    sponsorship_fee DECIMAL(10, 2) NOT NULL
);
